Patch Set 9:

(1 comment)

As you can see in the failed ASAN tests, the tablet_ access in Tablet::iterator::NextBlock isn't going to work because a concurrent tablet deletion could free the underlying memory. The scan itself is safe because the iterator holds references to all the sub-objects (diskrowsets, deltas, etc.) that are needed to satisfy the scan even if the Tablet itself is freed.

HandleNewScanRequest deals with this with the following code:

  // It's important to keep the reference to the tablet for the case when the
  // tablet replica's shutdown is run concurrently with the code below.
  shared_ptr<Tablet> tablet;
  RETURN_NOT_OK(GetTabletRef(replica, &tablet, error_code));

You could upgrade the raw Tablet pointer in Tablet::Iterator to a shared pointer, but I haven't thought through whether that's a good idea or not.
